const Index: NextPage = () => {
  return (
    <Layout>
      <Banner />
      <TextInput
        value="rot"
        onChange={(value: string) => {
          console.log(value);
        }}
      />
    </Layout>
  );
};

Index.getInitialProps = ({}) => ({});

export default Index;
